import React from 'react'
import _ from 'lodash'
import { store } from 'acey'
import { withAcey } from 'next-acey-wrapper'


const MyApp = props => {
  const { Component, pageProps } = props
  return (
    <Component {...pageProps} />
  )
}

export default withAcey(store, MyApp)
